def simulate_vim_commands(keylog):
    for command in keylog:
        parts = command.split('[ESC]')
        for i, part in enumerate(parts):
            if i > 0:
                pyautogui.press('esc')
                print("PART:\n",part)
                pyautogui.typewrite(part, interval=0.1)

            else:
                if '←' in part or '→' in part or '↑' in part or '↓' in part:
                    for segment in part:
                        if segment == '←':
                            print("KIRI")
                            pyautogui.press('left')
                        elif segment == '→':
                            print("KANAN")
                            pyautogui.press('right')
                        elif segment == '↑':
                            print("ATAS")
                            pyautogui.press('up')
                        elif segment == '↓':
                            print("BAWAH")
                            pyautogui.press('down')
                        else:
                            print("SEGMENT")
                            pyautogui.typewrite(segment, interval=0.3)

                else:
                    print("PART:\n",part)
                    pyautogui.typewrite(part, interval=0.1)


        time.sleep(0.5)

def main():
    # Make sure Vim is the active window
    time.sleep(3)  # Give yourself time to switch to the Vim window
    simulate_vim_commands(keylog)

if __name__ == '__main__':
    main()
